#ss = 'dabAcCaCBAcCcaDA'
ss = ''


def react(x, y):
    return x != y and x.lower() == y.lower()


def collapse(S):
    stack = []
    for c in S.strip():
        if stack and react(stack[-1], c):
            stack.pop()
        else:
            stack.append(c)
    return len(stack)


print(collapse(ss))
print(min([collapse(ss.replace(c, '').replace(c.lower(), ''))
           for c in set(ss.upper())]))
